import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankestein",
        },
        {
          name: "Dracula",
        },
        {
          name: "Zombie",
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>{this.state.string}</p>
          {this.state.monsters.map((monster) => (
            <h1>{monster.name}</h1>
          ))}
          <button onClick={() => this.setState({ string: "Hello Fucker" })}>
            Change Text
          </button>
        </header>
      </div>
    );
  }
}

export default App;
